    (m, n) = (len(grid), len(grid[-1]))
    moves = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    for i in range(m):
        for j in range(n):
            if grid[i][j] == '*':
                start = (i, j)
    queue = deque([(*start, 0)])
    visited = {start}
    while queue:
        (x, y, step) = queue.popleft()
        for (dx, dy) in moves:
            (nx, ny) = (x + dx, y + dy)
            if 0 <= nx < m and 0 <= ny < n and (grid[nx][ny] != 'X') and ((nx, ny) not in visited):
                if grid[nx][ny] == '#':
                    return step + 1
                queue.append((nx, ny, step + 1))
                visited.add((nx, ny))
    return -1

